import React from 'react'

function Footer() {
  return (
    <>
      <footer class="footer bg-black small text-center text-white-50"><div class="container px-4 px-lg-5">Ads Manager &copy; รับทำโฆษณาออนไลน์ สายเทา</div>
        <div class="text-center"> <a href="#"> <p>รับทำ seo สายเทา รับทำ seo สายดำ แอดสายเทา รับยิงแอดสายเทา กูเกิ้ลแอดสายเทา รับทํา google ads สายเทา seo สายเทา รับทำโฆษณาสายเทา ทำการตลาดสายเทา ads สายเทา รับทํา seo สายเทา ยิงแอดสายเทา โปรโมทสายเทา facebook ads สายเทา การตลาดสายเทา ยิงadsสายเทา ยิงแอด google สายเทา รับทำการตลาดสายเทา รับจ้างยิงแอดสายเทา โฆษณาสายเทา ตลาดสายเทา ads สายเทา แอดสายเทา ยิงแอดสายเทา pantip ยิงแอดสายเทาfacebook ทําseoสายเทา ยิงadsfacebookสายเทา ยิงแอดสายเทาเฮียบอย รับทำเว็บสายเทา การทำseoสายเทา ทำseoสายเทา ยิงแอดyoutubeสายเทา ยิงแอดสายเทาราคา ยิงแอดสายเทา2022 ยิงแอดสายดำ รับจ้างแอดสายเทา ยิงแอดสายเทาgoogle ตลาดสีเทา แอดสีเทา adsสีเทา กราฟฟิกสายเทา ยิงแอดเทา รับยิงแอดfacebookสายเทา รูปยิงแอดสายเทา รับจ้างสายเทา</p></a> </div>
        </footer>
      
    </>
  )
}

export default Footer
